import { useState } from "react";

const SearchBar = () => {
    let [input, setInput] = useState("")

    const handleSearch = (e) => {
        e.preventDefault();
        console.log(input)
    }

    return (
        <div className="flex justify-center items-center h-screen">
            <form onSubmit={handleSearch} className="relative w-full max-w-xs">
                <input
                    className="w-full p-4 pl-10 rounded-full border border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500"
                    placeholder="Search for an asset here.."
                    value = {input}
                    onChange = {(e) => setInput(e.target.value)}
                />
                <button 
                    type="submit"
                    className="absolute left-2 top-1/2 transform -translate-y-1/2 text-blue-500"
                >Submit</button>
            </form>
        </div>
    )
}

export default SearchBar
